import React, { useEffect } from 'react';
import './App.css';
//my imports
import HeaderBar from './components/HeaderBar';
import GrowthTable from './components/GrowthTable';


function App() {
	useEffect(() => {
		document.title = "Growths Calculator"
	})

  	return (
    	<div className="App">
      		<header className="App-header">
        		<HeaderBar />
      		</header>
	      	<body>
        		<GrowthTable />
	    	</body>
    	</div>
  	);
}

export default App;
